import React from 'react';
import s from './Home.module.css'


const Home = () => {
    return (
        <div >
            <div className={s.hero}>
                <div className={s.container}></div>
                <div className={s.contacts}>

                </div>
            </div>
        </div>
    );
};

export default Home;
